import React from 'react';
import { motion } from 'framer-motion';
import { FaRocket, FaCloud, FaShieldAlt, FaExpandArrowsAlt } from 'react-icons/fa';

const FeatureCard = ({ title, description, icon: Icon }) => (
  <motion.div 
    className="bg-gray-800 bg-opacity-50 p-6 rounded-lg shadow-lg backdrop-filter backdrop-blur-sm"
    initial={{ opacity: 0, y: 20 }}
    whileInView={{ opacity: 1, y: 0 }}
    transition={{ duration: 0.5 }}
    whileHover={{ scale: 1.05 }}
  >
    <Icon className="w-10 h-10 text-indigo-400 mb-4" />
    <h3 className="text-xl font-bold text-white mb-2">{title}</h3>
    <p className="text-gray-300">{description}</p>
  </motion.div>
);

const Info2 = () => {
  const features = [
    { title: "AI Integration", description: "Seamlessly integrate AI into your workflows", icon: FaRocket },
    { title: "Cloud Optimization", description: "Optimize your cloud infrastructure for peak performance", icon: FaCloud },
    { title: "Secure Development", description: "Build with security at the forefront", icon: FaShieldAlt },
    { title: "Scalable Architecture", description: "Design systems that grow with your business", icon: FaExpandArrowsAlt },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 to-gray-800 text-white overflow-hidden py-20 px-4 sm:px-6 lg:px-8">
      <div className="max-w-7xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-5xl font-bold mb-6 bg-clip-text text-transparent bg-gradient-to-r from-indigo-400 to-purple-500">
            Empowering Your Digital Transformation
          </h2>
          <p className="text-xl text-gray-300 max-w-2xl mx-auto">
            TokTok provides cutting-edge solutions to revolutionize your software development process.
          </p>
        </motion.div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
          {features.map((feature, index) => (
            <FeatureCard key={index} {...feature} />
          ))}
        </div>

        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="mt-20 text-center"
        >
          <h3 className="text-3xl font-bold mb-6">Ready to Transform Your Development Process?</h3>
          <p className="text-xl text-gray-300 mb-8 max-w-2xl mx-auto">
            Join thousands of companies that have accelerated their growth with TokTok's innovative solutions.
          </p>
          <motion.button 
            className="bg-indigo-600 text-white px-8 py-3 rounded-md font-medium text-lg hover:bg-indigo-700 transition-colors shadow-lg"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            Get Started Now
          </motion.button>
        </motion.div>
      </div>

      <motion.div 
        className="absolute bottom-0 left-0 w-full h-1/3 bg-gradient-to-t from-gray-900 to-transparent opacity-50"
        animate={{ 
          y: [0, -10, 0],
        }}
        transition={{ 
          duration: 5, 
          repeat: Infinity, 
          ease: "easeInOut" 
        }}
      />
    </div>
  );
};

export default Info2;
